import React from "react";

class Form extends React.Component {
    render () {
        return (
            <div className='form-container'>
                <h1 className='form-title'>
                    Заголовок формы
                </h1>

                <p className='form-text'>
                    Укажите поля и данные, которые необходимо заполнить клиенту
                    для заказа услуги или связи с вами.
                </p>

                <button className='form-button' aria-placeholder='Имя'></button>
                <button className='form-button' aria-placeholder='Email'></button>
                <button className='form-button' aria-placeholder='Текст'></button>
                <button className='form-button'>Отправить</button>
            </div>
        )
    }
}


export default Form;
